export function PostData(type, userData) {
  let BaseUrl = "http://localhost/login/api/demo.php";

  return new Promise((resolve, reject) => {
    fetch(BaseUrl, {
      method: "POST",
      body: JSON.stringify({
        userData: userData
      })
    })
      .then(response => response.json())
      .then(responseJson => {
        resolve(responseJson);
      })
      .catch(error => {
        reject(error);
      });
  });
}
